import React from 'react';
import PropTypes from 'prop-types';

class ArticleTableRow extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            selected: false
        };
    }

    onClick() {
        this.setState({
            selected: !this.state.selected
        });
    }

    render() {

        let selectedStatus;
        if (this.state.selected) {
            selectedStatus = 'Yes';
        } else {
            selectedStatus = 'No';
        }

